INSERT INTO `agents` (`id`, `name`, `description`, `rarity`, `image`) VALUES
('agent-4613', 'Bloody Darryl The Strapped | The Professionals', 'Before he was leader of the heist gang \'The Professionals\' Sir Bloody Darryl was more simply called, Bloody Darryl. Still your friendly neighborhood psychopath in every sense of the word. Not actually Australian according to Australians. \n\n<i>I\'m just gonna give them a bit of Razzle Dazzle.</i>', 'Superior', 'https://raw.githubusercontent.com/steamdatabase/gametracking-csgo/108f1682bf7eeb1420caaf2357da88b614a7e1b0/csgo/pak01_dir/resource/flash/econ/characters/customplayer_tm_professional_varf5.png'),
('agent-4619', '\'Blueberries\' Buckshot | NSWC SEAL', 'Known as SEAL Team\'s \"Weapons Sommelier\" Buckshot has thoroughly field-tested and reviewed almost every available military weapon in staggering depth. ST6 relies on Buckshot\'s knowledge of lesser-known guns for edge case advantages in ground based operations.\n\nSeen here sporting the classic NUE Type 1 uniform otherwise known as \'blueberries\'. \n\n<i>They talk to me. The guns. They have feelings.</i>', 'Exceptional', 'https://raw.githubusercontent.com/steamdatabase/gametracking-csgo/108f1682bf7eeb1420caaf2357da88b614a7e1b0/csgo/pak01_dir/resource/flash/econ/characters/customplayer_ctm_st6_variantj.png'),
('agent-4680', '\'Two Times\' McCoy | TACP Cavalry', '\'Two Times\' McCoy earned his nickname by completing TACP\'s field training twice. Official records mark this up to a scheduling mix-up, but his teammates report restraining him from completing the trifecta.\n\nWith inhuman reserves of physical and mental stamina, McCoy often finds himself the last person standing at the end of any conflict—physical and verbal alike.\n\nHis yellow scarf is a tribute to his time with 1st Cavalry Division.\n\n<i>Yep. Still here.</i>', 'Superior', 'https://raw.githubusercontent.com/steamdatabase/gametracking-csgo/108f1682bf7eeb1420caaf2357da88b614a7e1b0/csgo/pak01_dir/resource/flash/econ/characters/customplayer_ctm_st6_variantl.png'),
('agent-4711', 'Cmdr. Mae \'Dead Cold\' Jamison | SWAT', 'Cmdr. \'Dead Cold\' Jamison has just about seen it all. Skeptical and wry in the midst of deadly combat, others could mistake her for being nonchalant about the chaos at hand. They would be wrong. Nothing gets past Dead Cold, not bad guys with AK-47s, junior officers that call her \'Ma\'am,\' or an opportunity to make elite officers smirk under pressure.\n\n<i>You\'re gonna find out.</i>', 'Master', 'https://raw.githubusercontent.com/steamdatabase/gametracking-csgo/108f1682bf7eeb1420caaf2357da88b614a7e1b0/csgo/pak01_dir/resource/flash/econ/characters/customplayer_ctm_swat_variante.png'),
('agent-4712', '1st Lieutenant Farlow | SWAT', 'Smart as a whip and relentlessly polite, 1st Lieutenant Farlow is one of the most beloved and respected officers in SWAT. A master tactician in hostage and barricade situations, Farlow quickly climbed the SWAT ranks. Don\'t be fooled by her overwhelmingly cheerful nature--she can dispatch bad guys in the blink of an eye and not think twice about it.\n\n<i>What are they doing over there? Drinking milkshakes?</i>', 'Superior', 'https://raw.githubusercontent.com/steamdatabase/gametracking-csgo/108f1682bf7eeb1420caaf2357da88b614a7e1b0/csgo/pak01_dir/resource/flash/econ/characters/customplayer_ctm_swat_variantf.png'),
('agent-4713', 'John \'Van Healen\' Kask | SWAT', 'John \'Van Healen\' Kask is one of SWATs best tactical defence units and on-site military paramedics. He also shreds a mean guitar—sometimes mid-operation. He says it helps get his teammates\' blood pumping just as effectively as an AED, which he keeps ready in case of emergency. \n\n<i>I can bring you back to life, but I can\'t make you live.</i>', 'Exceptional', 'https://raw.githubusercontent.com/steamdatabase/gametracking-csgo/108f1682bf7eeb1420caaf2357da88b614a7e1b0/csgo/pak01_dir/resource/flash/econ/characters/customplayer_ctm_swat_variantg.png'),
('agent-4714', 'Bio-Haz Specialist | SWAT', 'The SWAT\'s Biological Hazard Specialists are trained to handle worst case bio warfare situations. Terrorists planning to unleash a bio hazard attack upon unsuspecting civilians do not want to deal with these guys.\n\n<i>Tacita Sed Mortiferum.</i>', 'Distinguished', 'https://raw.githubusercontent.com/steamdatabase/gametracking-csgo/108f1682bf7eeb1420caaf2357da88b614a7e1b0/csgo/pak01_dir/resource/flash/econ/characters/customplayer_ctm_swat_varianth.png'),
('agent-4715', 'Sergeant Bombson | SWAT', 'Tyler Bobson earned his moniker after becoming SWAT\'s go-to officer for efficient Explosive Ordnance Disposal. With his uncanny ability to locate even the most well hidden IEDs, Bombson\'s keen hearing is outclassed only by the noble Greater Wax Moth.\n\n<i>Yeah, I heard that.</i>', 'Exceptional', 'https://raw.githubusercontent.com/steamdatabase/gametracking-csgo/108f1682bf7eeb1420caaf2357da88b614a7e1b0/csgo/pak01_dir/resource/flash/econ/characters/customplayer_ctm_swat_varianti.png'),
('agent-4716', 'Chem-Haz Specialist | SWAT', 'The SWAT Chemical Hazard Specialists are able to survive and succeed in toxic environment operations for hours at a time. Where others run away, they run in.\n\n<i>Feels like home.</i>', 'Distinguished', 'https://raw.githubusercontent.com/steamdatabase/gametracking-csgo/108f1682bf7eeb1420caaf2357da88b614a7e1b0/csgo/pak01_dir/resource/flash/econ/characters/customplayer_ctm_swat_variantj.png'),
('agent-4718', 'Rezan the Redshirt | Sabre', 'An expert grenadier and the once-celebrated author of The Joy of Preparedness, Rezan the Redshirt is Sabre\'s self-appointed Head of Operations.\n\nOver time, Rezan has learned to control his fiery temper—now he wears his explosive rage on his sleeves.\n\n<i>I take great pride in my work.</i>', 'Superior', 'https://raw.githubusercontent.com/steamdatabase/gametracking-csgo/108f1682bf7eeb1420caaf2357da88b614a7e1b0/csgo/pak01_dir/resource/flash/econ/characters/customplayer_tm_balkan_variantk.png'),
('agent-4726', 'Sir Bloody Miami Darryl | The Professionals', 'The leader of \'The Professionals\' can be described as cocky, wisecracking, and scarily indifferent with regards to the suffering of others. He would say he\'s just a bloke—a bloke that likes to have a bit of fun on the weekend with the local armed tax collectors. He downplays the severity of any heavy situations that come his way, even if he\'s the last man standing, riddled with bullets, with only seconds left to blow the safe.\n\nThis white hockey mask and floral shirt were popular choices during his Vice pha', 'Master', 'https://raw.githubusercontent.com/steamdatabase/gametracking-csgo/108f1682bf7eeb1420caaf2357da88b614a7e1b0/csgo/pak01_dir/resource/flash/econ/characters/customplayer_tm_professional_varf.png'),
('agent-4727', 'Safecracker Voltzmann | The Professionals', 'Weird, quirky, unhinged; a few words that describe The Professionals\' safecracker and technical mastermind. When she is not mumbling to herself about the flawed assumptions inherent within the profit maximization paradox, Safecracker serves as a morally questionable but highly efficient \'fundraising expert.\' She enjoys short walks on pavement, the sound of cable ties being fastened, and testing explosive prototypes under immense pressure.\n\n<i>Don\'t blow it. DO blow the bomb though, okay? We do want that.</i', 'Superior', 'https://raw.githubusercontent.com/steamdatabase/gametracking-csgo/108f1682bf7eeb1420caaf2357da88b614a7e1b0/csgo/pak01_dir/resource/flash/econ/characters/customplayer_tm_professional_varg.png'),
('agent-4728', 'Little Kev | The Professionals', 'The Professional who makes heavy weapons look weightless, Little Kev is the soft spoken \'little\' brother of Sir Bloody Darryl. His older brother\'s bodyguard since age 5, Little Kev developed a knack for quelling \'people problems\' before they arise. Sir Darryl assigned him Human Resources Manager for the entire Professionals organization.  \n\n<i>We\'re getting this done either way.</i>', 'Exceptional', 'https://raw.githubusercontent.com/steamdatabase/gametracking-csgo/108f1682bf7eeb1420caaf2357da88b614a7e1b0/csgo/pak01_dir/resource/flash/econ/characters/customplayer_tm_professional_varh.png'),
('agent-4730', 'Getaway Sally | The Professionals', 'Small enough to hide in plain sight but loud enough to frighten the biggest enemies, Getaway Sally is The Professionals\' first pick for tight quarter Wealth Acquisition Projects.  A talented weaver of controlled chaos, Getaway Sally has the improvisational skills to turn the tables on any dire heist and hostage situations. \n\n<i>Now you don\'t see me, and now you still don\'t.</i>', 'Exceptional', 'https://raw.githubusercontent.com/steamdatabase/gametracking-csgo/108f1682bf7eeb1420caaf2357da88b614a7e1b0/csgo/pak01_dir/resource/flash/econ/characters/customplayer_tm_professional_varj.png'),
('agent-4732', 'Number K | The Professionals', 'In his \'Wealth Acquisition Specialist\' application form, Number K wrote the letter \'K\' in every number field, but his talent with handguns made him more than qualified for the position. Number K keeps the details of his life private—none of his colleagues have seen his face—making him one of The Professionals\' most feared heist managers.\n\n<i>Don\'t count us down. Just say go.</i>', 'Superior', 'https://raw.githubusercontent.com/steamdatabase/gametracking-csgo/108f1682bf7eeb1420caaf2357da88b614a7e1b0/csgo/pak01_dir/resource/flash/econ/characters/customplayer_tm_professional_vari.png'),
('agent-4733', 'Sir Bloody Silent Darryl | The Professionals', 'The leader of \'The Professionals\' can be described as cocky, wisecracking, and scarily indifferent with regards to the suffering of others. He would say he\'s just a bloke—a bloke that likes to have a bit of fun on the weekend with the local armed tax collectors. He downplays the severity of any heavy situations that come his way, even if he\'s the last man standing, riddled with bullets, with only seconds left to blow the safe.\n\nThis \'Vow of Silence\' mask was Darryl\'s response to organizational complaints ab', 'Master', 'https://raw.githubusercontent.com/steamdatabase/gametracking-csgo/108f1682bf7eeb1420caaf2357da88b614a7e1b0/csgo/pak01_dir/resource/flash/econ/characters/customplayer_tm_professional_varf1.png'),
('agent-4734', 'Sir Bloody Skullhead Darryl | The Professionals', 'The leader of \'The Professionals\' can be described as cocky, wisecracking, and scarily indifferent with regards to the suffering of others. He would say he\'s just a bloke—a bloke that likes to have a bit of fun on the weekend with the local armed tax collectors. He downplays the severity of any heavy situations that come his way, even if he\'s the last man standing, riddled with bullets, with only seconds left to blow the safe.\n\nThis black mask has been painted with a white skull, a useful bit of intimidatio', 'Master', 'https://raw.githubusercontent.com/steamdatabase/gametracking-csgo/108f1682bf7eeb1420caaf2357da88b614a7e1b0/csgo/pak01_dir/resource/flash/econ/characters/customplayer_tm_professional_varf2.png'),
('agent-4735', 'Sir Bloody Darryl Royale | The Professionals', 'The leader of \'The Professionals\' can be described as cocky, wisecracking, and scarily indifferent with regards to the suffering of others. He would say he\'s just a bloke—a bloke that likes to have a bit of fun on the weekend with the local armed tax collectors. He downplays the severity of any heavy situations that come his way, even if he\'s the last man standing, riddled with bullets, with only seconds left to blow the safe.\n\nThis gold mask with a crown stencil commemorates The Professionals\' first visit ', 'Master', 'https://raw.githubusercontent.com/steamdatabase/gametracking-csgo/108f1682bf7eeb1420caaf2357da88b614a7e1b0/csgo/pak01_dir/resource/flash/econ/characters/customplayer_tm_professional_varf3.png'),
('agent-4736', 'Sir Bloody Loudmouth Darryl | The Professionals', 'The leader of \'The Professionals\' can be described as cocky, wisecracking, and scarily indifferent with regards to the suffering of others. He would say he\'s just a bloke—a bloke that likes to have a bit of fun on the weekend with the local armed tax collectors. He downplays the severity of any heavy situations that come his way, even if he\'s the last man standing, riddled with bullets, with only seconds left to blow the safe.\n\nThis mask has been painted with clown makeup, perfect for taking candy from rich', 'Master', 'https://raw.githubusercontent.com/steamdatabase/gametracking-csgo/108f1682bf7eeb1420caaf2357da88b614a7e1b0/csgo/pak01_dir/resource/flash/econ/characters/customplayer_tm_professional_varf4.png'),
('agent-4749', 'Sous-Lieutenant Medic | Gendarmerie Nationale', 'Medics of the Gendarmerie National have a well-deserved reputation for providing life saving interventions using anything at their disposal. From improvised AEDs to jungle medicine to precise covering fire, the medics of the Gendarm have your back—no matter what. \n\n<i> It is better to prevent than to heal.</i>', 'Exceptional', 'https://raw.githubusercontent.com/steamdatabase/gametracking-csgo/108f1682bf7eeb1420caaf2357da88b614a7e1b0/csgo/pak01_dir/resource/flash/econ/characters/customplayer_ctm_gendarmerie_varianta.png'),
('agent-4750', 'Chem-Haz Capitaine | Gendarmerie Nationale', 'As leader for Chemical and BioHazard combat operations in populated areas, the Gendarmerie Chem-Haz Capitaine plays a crucial role within the organization. Celebrated for orchestrating the successful rescue of an entire domestic airport\'s civilian occupancy in the infamous sarin gas attack of 1997, the Chem-Haz Capitaine is the epitome of preparedness and composure.    \n\n<i>Don\'t forget to breathe.</i>', 'Superior', 'https://raw.githubusercontent.com/steamdatabase/gametracking-csgo/108f1682bf7eeb1420caaf2357da88b614a7e1b0/csgo/pak01_dir/resource/flash/econ/characters/customplayer_ctm_gendarmerie_variantb.png'),
('agent-4751', 'Chef d\'Escadron Rouchard | Gendarmerie Nationale', 'Born into an old aristocratic family, Rouchard enlisted in the Gendarmerie Nationale at her first opportunity as a way to avoid compulsory enrollment at a notorious Swiss finishing school for young women. As Aspirant in the Gendarmerie, Rouchard quickly impressed her senior ranks by excelling in offensive strategy and hostage negotiations, but most of all, blade-based combat. Several promotions later she is best known by her moniker \'Le Couteau\' (The Knife), although some would say this is because she can b', 'Master', 'https://raw.githubusercontent.com/steamdatabase/gametracking-csgo/108f1682bf7eeb1420caaf2357da88b614a7e1b0/csgo/pak01_dir/resource/flash/econ/characters/customplayer_ctm_gendarmerie_variantc.png'),
('agent-4752', 'Aspirant | Gendarmerie Nationale', 'Aspirants of the Gendarmerie are highly trained military police cadets responsible for assisting in rural combat operations. To say most are eager for action in the field is an understatement.   \n\n<i>C\'est la vie.</i>', 'Distinguished', 'https://raw.githubusercontent.com/steamdatabase/gametracking-csgo/108f1682bf7eeb1420caaf2357da88b614a7e1b0/csgo/pak01_dir/resource/flash/econ/characters/customplayer_ctm_gendarmerie_variantd.png'),
('agent-4753', 'Officer Jacques Beltram | Gendarmerie Nationale', 'A highly decorated Officer for the Gendarmerie, Beltram was awarded the Legion of Honor for swapping places with a hostage and thwarting terrorist activity on more than one occasion. Beltram is a hero, a single father, and a passionate consumer of pain au chocolate at all times of day.  \n\n<i>We do what we have to do.</i>', 'Exceptional', 'https://raw.githubusercontent.com/steamdatabase/gametracking-csgo/108f1682bf7eeb1420caaf2357da88b614a7e1b0/csgo/pak01_dir/resource/flash/econ/characters/customplayer_ctm_gendarmerie_variante.png'),
('agent-4756', 'Lieutenant \'Tree Hugger\' Farlow | SWAT', 'No one else knows how to enjoy combat ops that require sunscreen, mosquito repellant and M4A4 assault rifles quite like Farlow does. \n\n<i>Kinda nice to get out of the cold don\'t ya think?</i>', 'Exceptional', 'https://raw.githubusercontent.com/steamdatabase/gametracking-csgo/108f1682bf7eeb1420caaf2357da88b614a7e1b0/csgo/pak01_dir/resource/flash/econ/characters/customplayer_ctm_swat_variantk.png'),
('agent-4757', 'Cmdr. Davida \'Goggles\' Fernandez | SEAL Frogman', 'Possessing an exquisite mammalian dive reflex, Cmdr. Fernandez is able to slow her heart rate to undetectable levels and navigate darkness, ice, and deep sea defense systems. She excels in her human aquatic potential and her skill as an elite marksman and soldier. \'Goggles\' earned her nickname when a bullet struck her left eye—or would have—if it weren\'t for \'Wet Sox\' reminding her to grab her full kit \'for the last time!\' Despite her occasional forgetfulness, Cmdr. Fernandez is one of two elite combat dive', 'Master', 'https://raw.githubusercontent.com/steamdatabase/gametracking-csgo/108f1682bf7eeb1420caaf2357da88b614a7e1b0/csgo/pak01_dir/resource/flash/econ/characters/customplayer_ctm_diver_varianta.png'),
('agent-4771', 'Cmdr. Frank \'Wet Sox\' Baroud | SEAL Frogman', 'First on deck and last off it, Cmdr. Frank Baroud is a third generation SEAL and second combat diver ever to receive The Navy Cross medal; \'Goggles\' was the first. Count on Baroud to solve the most complicated underwater and ground based conflict situations, like the time he defused several IED\'s which were planted in a network of flooded caves beneath a US embassy. Baroud chalks it up to his impeccable attention to detail, because after all, when your life depends on the equipment you\'re wearing, a simple ', 'Master', 'https://raw.githubusercontent.com/steamdatabase/gametracking-csgo/108f1682bf7eeb1420caaf2357da88b614a7e1b0/csgo/pak01_dir/resource/flash/econ/characters/customplayer_ctm_diver_variantb.png'),
('agent-4772', 'Lieutenant Rex Krikey | SEAL Frogman', 'Lieutenant Krikey is a prime choice for all jungle and wetlands combat operations. His expertise in handling wild reptiles big and small has saved both him and his fellow frogmen on more than one occasion.\n\n<i>I\'m just an apex predator that enjoys meeting other apex predators.</i>', 'Superior', 'https://raw.githubusercontent.com/steamdatabase/gametracking-csgo/108f1682bf7eeb1420caaf2357da88b614a7e1b0/csgo/pak01_dir/resource/flash/econ/characters/customplayer_ctm_diver_variantc.png'),
('agent-4773', 'Elite Trapper Solman | Guerrilla Warfare', 'On a hot summer day on the outskirt islands of the Caribbean, Solman, relaxing on a small yet expensive vacation tour, was taken hostage by the infamous Guerrilla Warfare (GW). Overhearing his captors talk about the division of ransom money, Solman negotiated his own release if he delivered three additional hostages within 24 hours. And deliver he did, armed with only money, charm, and a way with words reserved for the world\'s most horrific cult leaders. Stunned by his lack of empathy for his fellow tourist', 'Superior', 'https://raw.githubusercontent.com/steamdatabase/gametracking-csgo/108f1682bf7eeb1420caaf2357da88b614a7e1b0/csgo/pak01_dir/resource/flash/econ/characters/customplayer_tm_jungle_raider_varianta.png'),
('agent-4774', 'Crasswater The Forgotten | Guerrilla Warfare', 'Former Navy SEAL Capt. Crasswater was taken prisoner by the Guerrilla Warfare (GW) while serving in the Middle East during the 1990\'s. After a botched rescue attempt by ST6 and subsequent military cover-up, the US Navy declared Crasswater deceased. Over the years of his imprisonment, his patriotism and \'no man left behind\' mantra eroded into bitter hatred for all things USA. Newly armed with a severe case of Stockholm Syndrome, Crasswater joined the Trappers of the GW. After a series of \'trust building\' att', 'Master', 'https://raw.githubusercontent.com/steamdatabase/gametracking-csgo/108f1682bf7eeb1420caaf2357da88b614a7e1b0/csgo/pak01_dir/resource/flash/econ/characters/customplayer_tm_jungle_raider_variantb.png'),
('agent-4775', 'Arno The Overgrown | Guerrilla Warfare', 'Disgraced heavyweight boxing champion, Arno The Overgrown was discovered by Guerrilla Warfare (GW) Trappers living out of a cave. Over the years Arno had become an expert survivalist and big-game hunter—able to live off the land for an indefinite amount of time carrying only his flint stick and sharpened hunting knife. Rumors of Arno eventually spread to nearby townships where he came to attention of Guerrilla Warfare (GW). Wanting to recruit Arno\'s flawless hunting and fighting skills, the GW failed to coa', 'Superior', 'https://raw.githubusercontent.com/steamdatabase/gametracking-csgo/108f1682bf7eeb1420caaf2357da88b614a7e1b0/csgo/pak01_dir/resource/flash/econ/characters/customplayer_tm_jungle_raider_variantc.png'),
('agent-4776', 'Col. Mangos Dabisi | Guerrilla Warfare', 'Early in his life Col. Mangos Dabisi was trained and promoted within Ugandan military. He ended his military career with a rare Dishonorable Discharge for intimidating his subordinates into paying him \'sleep well money\'—promising a good night\'s sleep to those who paid him. Turns out, a good night\'s sleep was merely a lack of intentional injuries inflicted by Dabisi himself. Dabisi\'s imposing stature and military skill made him an attractive acquisition for the Guerrilla Warfare (GW). Constantly over-using f', 'Exceptional', 'https://raw.githubusercontent.com/steamdatabase/gametracking-csgo/108f1682bf7eeb1420caaf2357da88b614a7e1b0/csgo/pak01_dir/resource/flash/econ/characters/customplayer_tm_jungle_raider_variantd.png'),
('agent-4777', 'Vypa Sista of the Revolution | Guerrilla Warfare', 'A notorious rebel and brilliant improviser, Vypa is one of twelve sisters born into poverty and left to fend for themselves at the age of seven. Vypa\'s solo attacks against her country\'s military dictatorship were so prolific the military assumed her work was the result of a small team of people. At one point, Vypa mistook a remote Guerrilla Warfare (GW) training ground for a government outpost. Shortly after invoking one of her infamous \'sting and choke\' maneuvers on the camp she realized her mistake, but ', 'Master', 'https://raw.githubusercontent.com/steamdatabase/gametracking-csgo/108f1682bf7eeb1420caaf2357da88b614a7e1b0/csgo/pak01_dir/resource/flash/econ/characters/customplayer_tm_jungle_raider_variante.png'),
('agent-4778', 'Trapper Aggressor | Guerrilla Warfare', 'The experienced and cunning Trapper Aggressors utilize ruthless efficiency in capturing and securing tourists as hostages. As experts in wetland and jungle-based guerrilla tactics, any rescue missions involving Trapper Aggressors are doomed to fail. \n\n<i>The promise of air conditioning and iced tea. It works every time.</i>', 'Distinguished', 'https://raw.githubusercontent.com/steamdatabase/gametracking-csgo/108f1682bf7eeb1420caaf2357da88b614a7e1b0/csgo/pak01_dir/resource/flash/econ/characters/customplayer_tm_jungle_raider_variantf.png'),
('agent-4780', '\'Medium Rare\' Crasswater | Guerrilla Warfare', 'Former Navy SEAL Capt. Crasswater was taken prisoner by the Guerrilla Warfare (GW) while serving in the Middle East during the 1990\'s. After a botched rescue attempt by ST6 and subsequent military cover-up, the US Navy declared Crasswater deceased. Over the years of his imprisonment, his patriotism and \'no man left behind\' mantra eroded into bitter hatred for all things USA. Newly armed with a severe case of Stockholm Syndrome, Crasswater joined the Trappers of the GW. After a series of \'trust building\' att', 'Master', 'https://raw.githubusercontent.com/steamdatabase/gametracking-csgo/108f1682bf7eeb1420caaf2357da88b614a7e1b0/csgo/pak01_dir/resource/flash/econ/characters/customplayer_tm_jungle_raider_variantb2.png'),
('agent-4781', 'Trapper | Guerrilla Warfare', 'Sharp, stealthy, and the bane of organised military units everywhere, the Trappers are rarely seen before they are felt.  \n\n<i>We hunt you.</i>', 'Exceptional', 'https://raw.githubusercontent.com/steamdatabase/gametracking-csgo/108f1682bf7eeb1420caaf2357da88b614a7e1b0/csgo/pak01_dir/resource/flash/econ/characters/customplayer_tm_jungle_raider_variantf2.png'),
('agent-5105', 'Ground Rebel  | Elite Crew', 'An expert in local knowledge for Elite Crew\'s urban operations, Ground Rebels are known for keeping an ear to the ground.\n\n<i>That\'s the signal.</i>', 'Distinguished', 'https://raw.githubusercontent.com/steamdatabase/gametracking-csgo/108f1682bf7eeb1420caaf2357da88b614a7e1b0/csgo/pak01_dir/resource/flash/econ/characters/customplayer_tm_leet_variantg.png'),
('agent-5106', 'Osiris | Elite Crew', 'Osiris earned his nickname from passing judgement, often too quickly, on his marks. His reasoning is simple: \"When your time is as valuable as mine, why make small talk?\" \n\nConfident, skilled, and quick to act, Osiris takes pleasure in dispatching targets with unrivaled efficiency.\n\n<i>Any objections?</i>', 'Exceptional', 'https://raw.githubusercontent.com/steamdatabase/gametracking-csgo/108f1682bf7eeb1420caaf2357da88b614a7e1b0/csgo/pak01_dir/resource/flash/econ/characters/customplayer_tm_leet_varianth.png'),
('agent-5107', 'Prof. Shahmat | Elite Crew', 'After graduating Magna Cum Laude, Prof. Shahmat began teaching to impart knowledge. With every class Shahmat realized his pupils didn\'t have the same revolutionary desires that he did. \n\nRecognizing that his mind was beginning to dull, he decided to seek a new challenge—mastering the art of war.\n\n<i>Watch and learn.</i>', 'Superior', 'https://raw.githubusercontent.com/steamdatabase/gametracking-csgo/108f1682bf7eeb1420caaf2357da88b614a7e1b0/csgo/pak01_dir/resource/flash/econ/characters/customplayer_tm_leet_varianti.png'),
('agent-5108', 'The Elite Mr. Muhlik | Elite Crew', 'First appeared operating as an \'Acquisitions Consultant\' for arms industry magnates, Mr. Muhlik quickly worked his way on to many Most Wanted lists worldwide. Unconfirmed reports suggest he is the last surviving heir to a recently-deposed Middle Eastern monarch. \n\nWith evidence of elite military training, international private education, and numerous international bank accounts, it\'s suspected Mr. Muhlik is maneuvering to rebuild sovereign power over his family\'s historical lands.\n\n<i>Pressure and time.</i>', 'Master', 'https://raw.githubusercontent.com/steamdatabase/gametracking-csgo/108f1682bf7eeb1420caaf2357da88b614a7e1b0/csgo/pak01_dir/resource/flash/econ/characters/customplayer_tm_leet_variantf.png'),
('agent-5109', 'Jungle Rebel | Elite Crew', 'Elite Crew\'s wetland and jungle based ground rebel. Deadly in the shade(s). \n\n<i>It\'s dark and I\'m wearing sunglasses.</i>', 'Distinguished', 'https://raw.githubusercontent.com/steamdatabase/gametracking-csgo/108f1682bf7eeb1420caaf2357da88b614a7e1b0/csgo/pak01_dir/resource/flash/econ/characters/customplayer_tm_leet_variantj.png'),
('agent-5205', 'Soldier | Phoenix', 'A capable shooter recruited by Phoenix to assist with Territory Reclamation Campaigns. Soldiers are extremely deadly alone, and even more so in numbers.\n\n<i>When do we shoot?</i>', 'Distinguished', 'https://raw.githubusercontent.com/steamdatabase/gametracking-csgo/108f1682bf7eeb1420caaf2357da88b614a7e1b0/csgo/pak01_dir/resource/flash/econ/characters/customplayer_tm_phoenix_varianth.png'),
('agent-5206', 'Enforcer | Phoenix', 'A multidisciplinary contract hitman for the Phoenix Connexion. Enforcers don\'t take all assignments, just the ones they find interesting.\n\n<i>Time is money.</i>', 'Distinguished', 'https://raw.githubusercontent.com/steamdatabase/gametracking-csgo/108f1682bf7eeb1420caaf2357da88b614a7e1b0/csgo/pak01_dir/resource/flash/econ/characters/customplayer_tm_phoenix_variantf.png'),
('agent-5207', 'Slingshot | Phoenix', 'Slingshot is a critical component of Phoenix Connexion\'s dominance in close-range combat.\n\nTightly wound and capable of devastating results with little resources, Slingshot earned his nickname after retaking the Phoenix compound with only an M9 Bayonet and recovered weapons.\n\n<i>If I can knife, I knife.</i>', 'Exceptional', 'https://raw.githubusercontent.com/steamdatabase/gametracking-csgo/108f1682bf7eeb1420caaf2357da88b614a7e1b0/csgo/pak01_dir/resource/flash/econ/characters/customplayer_tm_phoenix_variantg.png'),
('agent-5208', 'Street Soldier | Phoenix', 'A Phoenix ground force gang with expertise in high density urban environments. Their knowledge of back roads and alleyways are only surpassed by local taxi drivers, which are rumored to make up a significant portion of their numbers.\n\n<i>I know a shortcut.</i>', 'Distinguished', 'https://raw.githubusercontent.com/steamdatabase/gametracking-csgo/108f1682bf7eeb1420caaf2357da88b614a7e1b0/csgo/pak01_dir/resource/flash/econ/characters/customplayer_tm_phoenix_varianti.png'),
('agent-5305', 'Operator | FBI SWAT', 'Members of the FBI\'s SWAT team are deployed in high-risk situations. Counterterrorism, hostage rescue, and bomb defusals are a few of the many disciplines FBI SWAT agents specialize in.\n\n<i>Fidelity, Bravery, Integrity.</i>', 'Distinguished', 'https://raw.githubusercontent.com/steamdatabase/gametracking-csgo/108f1682bf7eeb1420caaf2357da88b614a7e1b0/csgo/pak01_dir/resource/flash/econ/characters/customplayer_ctm_fbi_variantf.png'),
('agent-5306', 'Markus Delrow | FBI HRT', 'There\'s no detail too small for Markus Delrow. Equipment, battle plans, oppositional tactics—you name it—and he\'s already thought of it twice. \n\nBeing two steps ahead is what he does best, and Delrow takes pride in being the brains of the operation.\n\n<i>All that\'s left is to execute.</i>', 'Exceptional', 'https://raw.githubusercontent.com/steamdatabase/gametracking-csgo/108f1682bf7eeb1420caaf2357da88b614a7e1b0/csgo/pak01_dir/resource/flash/econ/characters/customplayer_ctm_fbi_variantg.png'),
('agent-5307', 'Michael Syfers  | FBI Sniper', 'An ex-Division I athlete, Syfers was recruited by the FBI after a catastrophic knee injury ended his sports career early. Yet even in adversity he remained positive. \n\nIt\'s rare to find someone whose desire to succeed is matched by their desire to do good, but Syfers checks both boxes.\n\n<i>Naturally, I finished my reps.</i>', 'Superior', 'https://raw.githubusercontent.com/steamdatabase/gametracking-csgo/108f1682bf7eeb1420caaf2357da88b614a7e1b0/csgo/pak01_dir/resource/flash/econ/characters/customplayer_ctm_fbi_varianth.png'),
('agent-5308', 'Special Agent Ava | FBI', 'Initially underestimated, Special Agent Ava soon became her team\'s ultimate secret weapon. \n\nDespite receiving three out of five possible FBI Honorary Medals, Ava is surprisingly indifferent to her accomplishments. The way she sees it, it\'s nothing compared to growing up with four older brothers in urban New Jersey. \n\nSpecial Agent Ava takes pleasure from the simple things: clean wins, cold beer, and turning bad guys into thin crust pizza pie. \n\n<i>They see me. They\'re confused. And then they\'re dead.</i>', 'Master', 'https://raw.githubusercontent.com/steamdatabase/gametracking-csgo/108f1682bf7eeb1420caaf2357da88b614a7e1b0/csgo/pak01_dir/resource/flash/econ/characters/customplayer_ctm_fbi_variantb.png'),
('agent-5400', '3rd Commando Company | KSK', 'An elite soldier from Germany\'s Kommando Spezialkräfte, members of 3rd Commando Company are hand-picked to be part of KSK\'s Operational Forces.\n\n<i>This is not relevant to the task at hand.</i>', 'Distinguished', 'https://raw.githubusercontent.com/steamdatabase/gametracking-csgo/108f1682bf7eeb1420caaf2357da88b614a7e1b0/csgo/pak01_dir/resource/flash/econ/characters/customplayer_ctm_st6_variantk.png'),
('agent-5401', 'Seal Team 6 Soldier | NSWC SEAL', 'Combat-ready and hungry for wins, SEAL Team 6 soldiers know how to get the job done.\n\n<i>I\'m just happy to be here.</i>', 'Distinguished', 'https://raw.githubusercontent.com/steamdatabase/gametracking-csgo/108f1682bf7eeb1420caaf2357da88b614a7e1b0/csgo/pak01_dir/resource/flash/econ/characters/customplayer_ctm_st6_variante.png'),
('agent-5402', 'Buckshot | NSWC SEAL', 'Known as SEAL Team\'s \"Weapons Sommelier\" Buckshot has thoroughly field-tested and reviewed almost every available military weapon in staggering depth. ST6 relies on Buckshot\'s knowledge of lesser-known guns for edge case advantages in ground based operations—but in the interest of time, they strenuously avoid casual conversation on the topic.\n\n<i>They talk to me. The guns. They have feelings.</i>', 'Exceptional', 'https://raw.githubusercontent.com/steamdatabase/gametracking-csgo/108f1682bf7eeb1420caaf2357da88b614a7e1b0/csgo/pak01_dir/resource/flash/econ/characters/customplayer_ctm_st6_variantg.png'),
('agent-5403', '\'Two Times\' McCoy | USAF TACP', '\'Two Times\' McCoy earned his nickname by completing TACP\'s field training twice. Official records mark this up to a scheduling mix-up, but his teammates report restraining him from completing the trifecta.\n\nWith inhuman reserves of physical and mental stamina, McCoy often finds himself the last person standing at the end of any conflict—physical and verbal alike. \n\n<i>Yep. Still here.</i>', 'Superior', 'https://raw.githubusercontent.com/steamdatabase/gametracking-csgo/108f1682bf7eeb1420caaf2357da88b614a7e1b0/csgo/pak01_dir/resource/flash/econ/characters/customplayer_ctm_st6_variantm.png'),
('agent-5404', 'Lt. Commander Ricksaw | NSWC SEAL', 'Lt. Commander Ricksaw\'s comically laissez-faire attitude toward heavy combat keeps his SEAL team calm and deadly in the most dire situations. \n\nHaving lead more special ops than any other SEAL to date, Ricksaw knows life is short, and encourages his team to make the most of the time they have—including cheerfully serving up bullets and frag grenades to high- value targets at any and all occasions.\n\n<i>Hotdogs, hellcats and hand grenades. Hooya!</i>', 'Master', 'https://raw.githubusercontent.com/steamdatabase/gametracking-csgo/108f1682bf7eeb1420caaf2357da88b614a7e1b0/csgo/pak01_dir/resource/flash/econ/characters/customplayer_ctm_st6_varianti.png'),
('agent-5405', 'Primeiro Tenente | Brazilian 1st Battalion', 'As a combat survival specialist in deep jungle operations, the Brazilian 1st Battalion sharpen their teeth alongside the banks of the mighty Amazon River.   \n\n<i>Surprises welcome.</i>', 'Distinguished', 'https://raw.githubusercontent.com/steamdatabase/gametracking-csgo/108f1682bf7eeb1420caaf2357da88b614a7e1b0/csgo/pak01_dir/resource/flash/econ/characters/customplayer_ctm_st6_variantn.png'),
('agent-5500', 'Dragomir | Sabre', 'A man of few words, Dragomir is disturbingly patient. Known for holding position for days at a time, some say he\'s one of Sabre\'s best marksman. Others say he\'s napping. No one really knows. No one left alive, anyway.\n\n<i>...I wait.</i>', 'Exceptional', 'https://raw.githubusercontent.com/steamdatabase/gametracking-csgo/108f1682bf7eeb1420caaf2357da88b614a7e1b0/csgo/pak01_dir/resource/flash/econ/characters/customplayer_tm_balkan_variantf.png'),
('agent-5501', 'Maximus | Sabre', 'Motivated by a simmering inner rage and a lifelong obsession with vengeance for transgressions large, small, and seemingly insignificant, Maximus is Sabre\'s first choice for close quarter mission support. No grudge is too small to be repaid in blood.\n\n<i>No, YOU overreacted.</i>', 'Exceptional', 'https://raw.githubusercontent.com/steamdatabase/gametracking-csgo/108f1682bf7eeb1420caaf2357da88b614a7e1b0/csgo/pak01_dir/resource/flash/econ/characters/customplayer_tm_balkan_varianti.png'),
('agent-5502', 'Rezan The Ready | Sabre', 'An expert grenadier and the once-celebrated author of The Joy of Preparedness, Rezan The Ready is Sabre\'s self-appointed Head of Operations.\n\nHis fiery temper when things get out of hand has earned him the alternative nickname Rezan the Red—but never to his face.\n\n<i>I take great pride in my work.</i>', 'Superior', 'https://raw.githubusercontent.com/steamdatabase/gametracking-csgo/108f1682bf7eeb1420caaf2357da88b614a7e1b0/csgo/pak01_dir/resource/flash/econ/characters/customplayer_tm_balkan_variantg.png'),
('agent-5503', 'Blackwolf | Sabre', 'Blackwolf stalks Sabre\'s enemies with preternatural determination and focus. Raised deep within the bitter forests of Eastern Europe, he can sense human presence with exceptional accuracy—and he knows what to do when he\'s sensed it. \n\n<i>I don\'t need to see them to kill them.</i>', 'Superior', 'https://raw.githubusercontent.com/steamdatabase/gametracking-csgo/108f1682bf7eeb1420caaf2357da88b614a7e1b0/csgo/pak01_dir/resource/flash/econ/characters/customplayer_tm_balkan_variantj.png'),
('agent-5504', '\'The Doctor\' Romanov | Sabre', 'After expertly smuggling pharmaceuticals across disputed borders for over 30 years, the \'doctor\' now leads Sabre\'s Utility Disruption Operations. Rumoured to be responsible for the synchronized destruction of several UN power facilities, Romanov is known by his enemies to be calculating, deliberate, and frighteningly precise. Of course, his mother says he\'s just mixed up with the wrong crowd.\n\n<i>It\'s simple. We make a plan and the plan is to win.</i>', 'Master', 'https://raw.githubusercontent.com/steamdatabase/gametracking-csgo/108f1682bf7eeb1420caaf2357da88b614a7e1b0/csgo/pak01_dir/resource/flash/econ/characters/customplayer_tm_balkan_varianth.png'),
('agent-5505', 'Dragomir | Sabre Footsoldier', 'Sabre has noticed that enemies seem to die quite frequently around Dragomir, even though they\'ve never actually seen him shoot his gun. They\'re happy to keep him around... for now. \n\n<i>...I wait.</i>', 'Distinguished', 'https://raw.githubusercontent.com/steamdatabase/gametracking-csgo/108f1682bf7eeb1420caaf2357da88b614a7e1b0/csgo/pak01_dir/resource/flash/econ/characters/customplayer_tm_balkan_variantl.png'),
('agent-5601', 'B Squadron Officer | SAS', 'Highly classified and incredibly lethal, Officers in the SAS spend years sharpening their skills through infiltration, hostage rescue, and —REDACTED— missions not fit for the public eye.\n\n<i>Who dares, wins.</i>', 'Distinguished', 'https://raw.githubusercontent.com/steamdatabase/gametracking-csgo/108f1682bf7eeb1420caaf2357da88b614a7e1b0/csgo/pak01_dir/resource/flash/econ/characters/customplayer_ctm_sas_variantf.png'),
('agent-5602', 'D Squadron Officer | NZSAS', 'Highly classified and incredibly lethal, Officers in the SAS spend years sharpening their skills through infiltration, hostage rescue, and —REDACTED— missions not fit for the public eye.\n\n<i>Who dares, wins.</i>', 'Distinguished', 'https://raw.githubusercontent.com/steamdatabase/gametracking-csgo/108f1682bf7eeb1420caaf2357da88b614a7e1b0/csgo/pak01_dir/resource/flash/econ/characters/customplayer_ctm_sas_variantg.png');
