INSERT INTO `music-kits` (`id`, `name`, `description`, `rarity`, `exclusive`, `image`) VALUES
('music-kit-10', 'Music Kit | Sasha, LNOE', 'Immerse yourself in this cinematic soundtrack full of soaring strings, pulsating melodies and driving drums from the world renowned DJ / Producer Sasha', 'High Grade', '', 'https://raw.githubusercontent.com/steamdatabase/gametracking-csgo/108f1682bf7eeb1420caaf2357da88b614a7e1b0/csgo/pak01_dir/resource/flash/econ/music_kits/sasha_01.png'),
('music-kit-11', 'Music Kit | Skog, Metal', 'A lesson in aggression from Metal producer, Skog.', 'High Grade', '', 'https://raw.githubusercontent.com/steamdatabase/gametracking-csgo/108f1682bf7eeb1420caaf2357da88b614a7e1b0/csgo/pak01_dir/resource/flash/econ/music_kits/skog_01.png'),
('music-kit-12', 'Music Kit | Midnight Riders, All I Want for Christmas', '\"HAPPY HOLIDAYS, ****ERS!\"\n    -Midnight Riders', 'High Grade', '', 'https://raw.githubusercontent.com/steamdatabase/gametracking-csgo/108f1682bf7eeb1420caaf2357da88b614a7e1b0/csgo/pak01_dir/resource/flash/econ/music_kits/midnightriders_01.png'),
('music-kit-13', 'Music Kit | Matt Lange, IsoRhythm', 'Indulge your aural senses in a collection of cinematic, glitchy atmospheres and hard-hitting throbbing rhythms by electronic producer and innovator Matt Lange.', 'High Grade', '', 'https://raw.githubusercontent.com/steamdatabase/gametracking-csgo/108f1682bf7eeb1420caaf2357da88b614a7e1b0/csgo/pak01_dir/resource/flash/econ/music_kits/mattlange_01.png'),
('music-kit-14', 'Music Kit | Mateo Messina, For No Mankind', 'Own your enemies. Pure intensity by Grammy winning composer, Mateo Messina.', 'High Grade', '', 'https://raw.githubusercontent.com/steamdatabase/gametracking-csgo/108f1682bf7eeb1420caaf2357da88b614a7e1b0/csgo/pak01_dir/resource/flash/econ/music_kits/mateomessina_01.png'),
('music-kit-15', 'Music Kit | Various Artists, Hotline Miami', 'A multitude of electronic artists deliver brutal beats in this exhilarating Music Pack from the iconic Hotline Miami.', 'High Grade', '', 'https://raw.githubusercontent.com/steamdatabase/gametracking-csgo/108f1682bf7eeb1420caaf2357da88b614a7e1b0/csgo/pak01_dir/resource/flash/econ/music_kits/hotlinemiami_01.png'),
('music-kit-16', 'Music Kit | Daniel Sadowski, Total Domination', 'Composer Daniel Sadowski raises the bar with aggressive electronic beats, creative sound fx and an exhilerating, driving, futuristic vibe. \"Warning: Will cause a rise in adrenaline!\"', 'High Grade', '', 'https://raw.githubusercontent.com/steamdatabase/gametracking-csgo/108f1682bf7eeb1420caaf2357da88b614a7e1b0/csgo/pak01_dir/resource/flash/econ/music_kits/danielsadowski_02.png'),
('music-kit-17', 'Music Kit | Damjan Mravunac, The Talos Principle', 'Composer Damjan Mravunac blends energetic cinematic grooves with epic choirs in this music pack featuring music from Croteam\'s critically acclaimed title \"The Talos Principle\".', 'High Grade', '', 'https://raw.githubusercontent.com/steamdatabase/gametracking-csgo/108f1682bf7eeb1420caaf2357da88b614a7e1b0/csgo/pak01_dir/resource/flash/econ/music_kits/damjanmravunac_01.png'),
('music-kit-18', 'Music Kit | Proxy, Battlepack', 'Russian Heavy Electronica Artist PROXY brings his own Unique heavy artillery to Counter Strike. Hybrid audio Weaponry fused with the finest studio technology makes this pack unique.', 'High Grade', '', 'https://raw.githubusercontent.com/steamdatabase/gametracking-csgo/108f1682bf7eeb1420caaf2357da88b614a7e1b0/csgo/pak01_dir/resource/flash/econ/music_kits/proxy_01.png'),
('music-kit-19', 'Music Kit | Ki:Theory, MOLOTOV', 'Recording artist and DOTA TI4 performer, Ki:Theory drops BOMBS with this searing set of razor edge dark electronic rock.', 'High Grade', '', 'https://raw.githubusercontent.com/steamdatabase/gametracking-csgo/108f1682bf7eeb1420caaf2357da88b614a7e1b0/csgo/pak01_dir/resource/flash/econ/music_kits/kitheory_01.png'),
