('music-kit-68', 'Music Kit | Perfect World, 花脸 Hua Lian (Painted Face)', 'Celebrate the 5th anniversary of CS:GO\'s release in China with a one of a kind music kit, 花脸 Hua Lian (Painted Face). This kit combines folk Qinqiang opera (the earliest Chinese style Rock \'n\' Roll) and modern Rock \'n\' Roll. Whether you are engulfed in smoke or blinded by a flashbang, don\'t get lost!', 'High Grade', '', 'https://raw.githubusercontent.com/steamdatabase/gametracking-csgo/108f1682bf7eeb1420caaf2357da88b614a7e1b0/csgo/pak01_dir/resource/flash/econ/music_kits/perfectworld_01.png'),
('music-kit-69', 'Music Kit | Denzel Curry, ULTIMATE', 'Denzel brings his signature energy to CS:GO as he traverses trap, jazz, and drum and bass beats. This kit features Denzel\'s hits \"Walkin\", \"ULTIMATE\", and more, so break out the nickel-plated chrome Berettas and crank up the intensity with the ULTIMATE music kit.', 'High Grade', '', 'https://raw.githubusercontent.com/steamdatabase/gametracking-csgo/108f1682bf7eeb1420caaf2357da88b614a7e1b0/csgo/pak01_dir/resource/flash/econ/music_kits/denzelcurry_01.png'),
('music-kit-7', 'Music Kit | Feed Me, High Noon', 'Renowned elecronic musician Feed Me, brings a western corral showdown into a modern electronic space.', 'High Grade', '', 'https://raw.githubusercontent.com/steamdatabase/gametracking-csgo/108f1682bf7eeb1420caaf2357da88b614a7e1b0/csgo/pak01_dir/resource/flash/econ/music_kits/feedme_01.png'),
('music-kit-8', 'Music Kit | Dren, Death\'s Head Demolition', 'From game music composer Dren, this cinematic, superhero-metal inspired music pack puts the \'ill\' into KILL!', 'High Grade', '', 'https://raw.githubusercontent.com/steamdatabase/gametracking-csgo/108f1682bf7eeb1420caaf2357da88b614a7e1b0/csgo/pak01_dir/resource/flash/econ/music_kits/dren_01.png'),
('music-kit-9', 'Music Kit | Austin Wintory, Desert Fire', 'Grammy nominated game composer Austin Wintory asks, why bother hunting your enemies when you can lure them in with a deadly, admittedly insane, tango?', 'High Grade', '', 'https://raw.githubusercontent.com/steamdatabase/gametracking-csgo/108f1682bf7eeb1420caaf2357da88b614a7e1b0/csgo/pak01_dir/resource/flash/econ/music_kits/austinwintory_01.png');
